import {Container,Row,Col} from 'react-bootstrap'
export const Footer = () => {
     return (
          <footer>
               <Container><Row><col className="text-center py-3">
                    Copyright @copy Shoping
                    
                    </col></Row></Container>
               Footer
          </footer>
     )
}
